import React from 'react';
import { Progress, Card, Row, Col, Typography } from 'antd';
import '../../styles/Dashboard.css'; // Import your styles here

const { Title } = Typography;

const Dashboard = () => {
  return (
    <div className="dashboard">
      {/* Title for Energy Summary */}
      <Title level={2} className="section-title">
        Energy Summary
      </Title>

      {/* Energy Summary Section */}
      <Row gutter={[16, 16]} className="energy-summary">
        <Col xs={24} sm={12}>
          <Card className="energy-card" bordered={false}>
            <div className="progress-container">
              <Progress
                type="circle"
                percent={50}
                strokeColor="#0072FD"
                strokeWidth={12} 
                format={() => '938 Kcal'}
                width={150}
              />
              <p>Calorie consumed</p>
            </div>
          </Card>
        </Col>
        <Col xs={24} sm={12}>
          <Card className="energy-card" bordered={false}>
            <div className="progress-container">
              <Progress
                type="circle"
                percent={50}
                strokeColor="#00C0FD"
                strokeWidth={12} 
                format={() => '938 '}
                width={150}
              />
              <p>Calorie remaining</p>
            </div>
          </Card>
        </Col>
      </Row>

      {/* Title for Macro Targets */}
      <Title level={2} className="section-title">
        Macro Targets
      </Title>

      {/* Macro Targets Section */}
      <Row gutter={[16, 16]} className="macro-targets">
        <Col xs={24} sm={8}>
          <Card className="macro-card" bordered={false}>
            <div className="progress-container">
            <div className="progress-info">
                <p>345/453 (g)</p>
                <p>Fat</p>
              </div>
              <Progress
                type="circle"
                percent={75}
                strokeColor="#5E5CE6"
                strokeWidth={10}
                format={() => '75%'}
                width={70}
              />
              
            </div>
          </Card>
        </Col>
        <Col xs={24} sm={8}>
          <Card className="macro-card" bordered={false}>
            <div className="progress-container">
            <div className="progress-info">
                <p>345/453 (g)</p>
                <p>Fat</p>
              </div>
              <Progress
                type="circle"
                percent={75}
                strokeColor="#5E5CE6"
                strokeWidth={10}
                format={() => '75%'}
                width={70}
              />
             
            </div>
          </Card>
        </Col>
        <Col xs={24} sm={8}>
          <Card className="macro-card" bordered={false}>
            <div className="progress-container">
            <div className="progress-info">
                <p>345/453 (g)</p>
                <p>Fat</p>
              </div>
              <Progress
                type="circle"
                percent={75}
                strokeColor="#5E5CE6"
                strokeWidth={10}
                format={() => '75%'}
                width={70}
              />
              
            </div>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Dashboard;
